// src/components/Sidebar.js
import React from 'react';
import '../styles/Sidebar.css';  // Pastikan path-nya benar


const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="logo-container">
        <img src="logo.png" alt="Logo" />
      </div>
      <ul id="menu">
        <li className="active"><a href="index.html"><i className="fas fa-home"></i> Home</a></li>
        <li><a href="about.html"><i className="fas fa-info-circle"></i> Tentang Kami</a></li>
        <li><a href="konsultasi.html"><i className="fas fa-phone"></i> Konsultasi</a></li>
        <li><a href="program.html"><i className="fas fa-tasks"></i> Program Kami</a></li>
        <li><a href="transaksi.html"><i className="fas fa-money-bill"></i> Transaksi</a></li>
        <li><a href="berita.html"><i className="fas fa-newspaper"></i> Berita</a></li>
        <li><a href="kontak.html"><i className="fas fa-envelope"></i> Kontak Kami</a></li>
      </ul>
      <div className="logout-container">
        <div className="logout"><i className="fas fa-sign-out-alt"></i> Logout</div>
      </div>
    </div>
  );
};

export default Sidebar;
